export function TypesSelection(props) {
    return (
        <HStack spacing={2}>
            <Text>Select types :</Text>
            <CheckboxGroup>
                <HStack spacing={4}>
                    <Checkbox value="creatrue">Creatrue</Checkbox>
                    <Checkbox value="artifact">Artifact</Checkbox>
                    <Checkbox value="enchantment">Enchantment</Checkbox>
                    <Checkbox value="planeswalker">Planeswalker</Checkbox>
                    <Checkbox value="instant">Instant</Checkbox>
                    <Checkbox value="sorcery">Sorcery</Checkbox>
                    <Checkbox value="land">Land</Checkbox>
                    <Checkbox value="tribal">Tribal</Checkbox>
                </HStack>
            </CheckboxGroup>
         </HStack>
    );
}
